css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("ieee.org")

{

/*text&background*/

html, body, tbody, thead, th, tr, td, blockquote, li, ul, h1, h2, h3, h4, h5, h6, font, strong, p, form, footer

{
color: white !important;
background: black !important;
}

select, button, div#srch-wrap, div.home-boxes-top, div.home-boxes, div.content-callout-356-indent, div.content-lc-lnav, div.boxes-375, div#content-type-home-top div, div#content-type-home-middle-contents, ul.tab-navi li a, div.tab-content-box, div.content, div#content-type-lower-information, div#content-type-share-links, div#share-links, div.box-c, div.content-lc-bottom

{
background: black !important;
}

div, span

{
background-color: black !important;
}

select, input, span, code, textarea, pre, label, div, dd

{
color: white !important;
}


/*links*/

a

{
color: #0040ff !important;
}

a:visited

{
color: #224375 !important;
}

/*highlight*/

textarea, pre, input, code

{
background: #333333 !important;
}

}
